import '../App.css';

const Header = () => {
    return(
        <nav>
            <div classname='div-header'>
                <div style={{display: 'flex', flexDirection: 'row'}}>
                    <p1>Header</p1>
                </div>
            </div>
        </nav>
    )
}

export default Header;
